import { Lens } from "monocle-ts";
import * as _ from "lodash";

export type HandRow = "row1" | "row2" | "row3" | "row4";
export type HandCol = "col1" | "col2" | "col3" | "col4" | "col5" | "col6";

export type MiddleRow = "row1" | "row2" | "row3";

export type ThumbCol = "col1" | "col2" | "col3" | "col4";

export type Side = "left" | "right";

export type HandMapKey = {
    side: Side;
    type: "hand";
    row: HandRow;
    col: HandCol;
};

export type FnKey = {
    side: Side;
    type: "fn"
};

export type ThumbMapKey = {
    side: Side;
    type: "thumb";
    col: ThumbCol;
};

export type MiddleMapKey = {
    side: Side;
    type: "middle";
    row: MiddleRow;
};

export type PhysicalMapKey = HandMapKey | ThumbMapKey | MiddleMapKey | FnKey;

export function physKeyToLens<A>(k:PhysicalMapKey): Lens<PhysicalMap<A>, A> {
    const sL = k.side === "left" ? leftL<A>() : rightL<A>();
    if (k.type === "hand") {
        return sL.compose(handL<A>().compose(handRowL<A>(k.row).compose(handColL<A>(k.col))));
    } else if (k.type === "thumb") {
        return sL.compose(thumbL<A>().compose(thumbColL<A>(k.col)));
    } else if (k.type === "middle") {
        return sL.compose(middleL<A>().compose(middleRowL<A>(k.row)));
    } else if (k.type === "fn") {
        return sL.compose(fnL<A>());
    } else {
        return {} as never;
    }
}

export function physKeyToStr(k: PhysicalMapKey): string {
    const parts: string[] = [k.side, k.type];
    if (k.type === "hand") {
        parts.push(k.row, k.col);
    } else if (k.type === "thumb") {
        parts.push(k.col);
    } else if (k.type === "middle") {
        parts.push(k.row);
    }

    return parts.join(".");
}

export const allPhysKeys: PhysicalMapKey[] =
    _.flatMap(["left", "right"], (side) => {
        return _.flatMap(["hand", "thumb", "middle", "fn"], (type) => {
            if (type === "hand") {
                return _.flatMap(["row1", "row2", "row3", "row4"], (row: HandRow) => {
                    return _.flatMap(
                        ["col1", "col2", "col3", "col4", "col5", "col6"],
                        (col: HandCol) => {
                            return { side, type, row, col } as PhysicalMapKey;
                        },
                    );
                });
            } else if (type === "thumb") {
                return ["col1", "col2", "col3", "col4"].map((col) => {
                    return { side, type, col } as PhysicalMapKey;
                });
            } else if (type === "middle") {
                return ["row1", "row2", "row3"].map((row: MiddleRow) => {
                    return { side, type, row } as PhysicalMapKey;
                });
            } else if (type === "fn") {
                return [{ side, type }] as PhysicalMapKey[];
            } else {
                return [];
            }
        });
    });

export function physMapToList<A>(m: PhysicalMap<A>): [PhysicalMapKey, A][] {
    return allPhysKeys.map<[PhysicalMapKey, A]>(k => [k, physKeyToLens<A>(k).get(m)]);
}

export function mapMap<A, B>(f: (a:A) => B, m: PhysicalMap<A>): PhysicalMap<B> {
    const fNew = (a:A, k: PhysicalMapKey) => f(a);
    return mapMapWithKey(fNew, m);
}

export function mapMapWithKey<A, B>(
    f: (a:A, k:PhysicalMapKey) => B,
    m: PhysicalMap<A>,
): PhysicalMap<B> {
    return {
        left: mapSide(f, "left", m.left),
        right: mapSide(f, "right", m.right),
    };
}

function mapSide<A, B>(
    f: (a:A, k:PhysicalMapKey) => B,
    side: Side,
    m: PhysicalSideMap<A>,
): PhysicalSideMap<B> {
    return {
        hand: mapHand(f, side, m.hand),
        thumb: mapThumb(f, side, m.thumb),
        middle: mapMiddle(f, side, m.middle),
        fn: f(m.fn, { side, type: "fn" }),
    };
}

function mapMiddle<A, B>(
    f: (a:A, k: PhysicalMapKey) => B,
    side: Side,
    m: PhysicalMiddleMap<A>,
): PhysicalMiddleMap<B> {
    return {
        row1: f(m.row1, { side, type: "middle", row: "row1" }),
        row2: f(m.row2, { side, type: "middle", row: "row2" }),
        row3: f(m.row3, { side, type: "middle", row: "row3" }),
    };
}

function mapThumb<A, B>(
    f: (a:A, k:PhysicalMapKey) => B,
    side: Side,
    m:PhysicalThumbMap<A>,
): PhysicalThumbMap<B> {
    return {
        col1: f(m.col1, { side, type: "thumb", col: "col1" }),
        col2: f(m.col2, { side, type: "thumb", col: "col2" }),
        col3: f(m.col3, { side, type: "thumb", col: "col3" }),
        col4: f(m.col4, { side, type: "thumb", col: "col4" }),
    };
}

function mapHand<A, B>(
    f: (a:A, k:PhysicalMapKey) => B,
    side: Side,
    m: PhysicalHandMap<A>,
): PhysicalHandMap<B> {
    return {
        row1: mapRow(f, side, "row1", m.row1),
        row2: mapRow(f, side, "row2", m.row2),
        row3: mapRow(f, side, "row3", m.row3),
        row4: mapRow(f, side, "row4", m.row4),
    };
}

function mapRow<A, B>(
    f: (a:A, k:PhysicalMapKey) => B,
    side: Side,
    row: HandRow,
    m:PhysicalHandRowMap<A>,
): PhysicalHandRowMap<B> {
    return {
        col1: f(m.col1, { side, type: "hand", row, col: "col1" }),
        col2: f(m.col2, { side, type: "hand", row, col: "col2" }),
        col3: f(m.col3, { side, type: "hand", row, col: "col3" }),
        col4: f(m.col4, { side, type: "hand", row, col: "col4" }),
        col5: f(m.col5, { side, type: "hand", row, col: "col5" }),
        col6: f(m.col6, { side, type: "hand", row, col: "col6" }),
    };
}

export function leftL<A>(): Lens<PhysicalMap<A>, PhysicalSideMap<A>> {
    return Lens.fromProp("left");
}

export function rightL<A>(): Lens<PhysicalMap<A>, PhysicalSideMap<A>> {
    return Lens.fromProp("right");
}

export function handL<A>(): Lens<PhysicalSideMap<A>, PhysicalHandMap<A>> {
    return Lens.fromProp("hand");
}

export function middleL<A>(): Lens<PhysicalSideMap<A>, PhysicalMiddleMap<A>> {
    return Lens.fromProp("middle");
}

export function thumbL<A>(): Lens<PhysicalSideMap<A>, PhysicalThumbMap<A>> {
    return Lens.fromProp("thumb");
}

export function fnL<A>(): Lens<PhysicalSideMap<A>, A> {
    return Lens.fromProp("fn");
}

export function handRowL<A>(r:HandRow): Lens<PhysicalHandMap<A>, PhysicalHandRowMap<A>> {
    return Lens.fromProp(r);
}

export function handColL<A>(c:HandCol): Lens<PhysicalHandRowMap<A>, A> {
    return Lens.fromProp(c);
}

export function thumbColL<A>(c:ThumbCol): Lens<PhysicalThumbMap<A>, A> {
    return Lens.fromProp(c);
}

export function middleRowL<A>(r:MiddleRow): Lens<PhysicalMiddleMap<A>, A> {
    return Lens.fromProp(r);
}

export interface PhysicalMap<A> {
    left: PhysicalSideMap<A>;
    right: PhysicalSideMap<A>;
}

export interface PhysicalSideMap<A> {
    hand: PhysicalHandMap<A>;
    middle: PhysicalMiddleMap<A>;
    thumb: PhysicalThumbMap<A>;
    fn: A;
}

export interface PhysicalHandMap<A> {
    row1: PhysicalHandRowMap<A>;
    row2: PhysicalHandRowMap<A>;
    row3: PhysicalHandRowMap<A>;
    row4: PhysicalHandRowMap<A>;
}

export interface PhysicalHandRowMap<A> {
    col1: A;
    col2: A;
    col3: A;
    col4: A;
    col5: A;
    col6: A;
}

export interface PhysicalMiddleMap<A> {
    row1: A;
    row2: A;
    row3: A;
}

export interface PhysicalThumbMap<A> {
    col1: A;
    col2: A;
    col3: A;
    col4: A;
}

